        title: '《電腦設備》宏碁3月傳捷報，在美市占率衝高',
        content: '【時報記者任珮云台北報導】根據市調機構NPD的最新數據，宏碁(2353)Chromebase和Chromebox產品，在美國直銷通路的市場占有率在今年3月衝上新高，達到31.17％；而以零售市場營業額占比的市占率來看，Acer同月份中也站上同業頂峰。根據NPD的資料，宏碁2017年第一季消費型Chromebook的銷售額提升70％以上，遠高於業界平均水準；此外，宏碁的消費型Chromebook的平均銷售價格（ASP）也高於業界水準，呈現上升趨勢。2017年3月以品牌區分營業額的占比來看，宏碁領先其他品牌，在市場中占有40％的極高占有率，大幅超越競爭對手近8％。\r\n\r\n  宏碁自2014年推出首款Chromebox以來，不論Chromebase和Chromebox裝置的簡單易用和便於管理的特性，已經受到客戶的歡迎與高度肯定，市占率也穩步增長，上個月根據另一市調機構發表的最新數據，宏碁的Chromebook以28％的高市占率，穩居2016年全球Chromebook產品的龍頭，且年增率高達33％。今年初也發表了首款具有四種可翻轉模式的Acer Chromebook Spin 11，搭配Wacom EMR（電磁諧振）觸控筆，更適合作為教育環境的學習工具。\r\n  宏碁105年股利發放維持和前一年相當，都是現金0.5元。此外，宏碁春季新品發表會「next@acer 2017」，預計將在台北時間27日的晚上十一點，於美國紐約舉行，並舉辦全球同步連線。\r\n',
        source: '時訊',
        id: 1202
