        title: '《產業》母親節檔期開跑，百貨業衝刺',
        content: '【時報記者沈培華台北報導】今年第一季百貨業者平均業績下滑，迎接上半年母親節最大檔期，紛紛祭出優惠。太平洋SOGO百貨3月在化妝品帶動下，營收已見回溫，4月27日起推出母親節眾多好康，力拚業績逆轉年增5%。遠百(2903)也加碼抽汽車三台。新光三越則瞄準百萬卡友推好康。\r\n  太平洋SOGO百貨忠孝店今年30周年，強調推出的母親節回饋為史上最優、周年慶規格；SOGO先前的暖身優惠活動，帶動化妝品業績成長了13%，也使得SOGO百貨3月營收逆升，成長1%多。以精品為主的SOGO百貨復興店在第一季也相對其他百貨業績有撐。\r\n  太平洋SOGO百貨台北店三館將於4月27日至5月14日推出母親節優惠，目標18天業績35億元，年增5%。\r\n\r\n  太平洋SOGO百貨忠孝、復興館、敦化三店27日起推出母親節全館商品8折起，除了女裝、女鞋、家電3C、寢具、鍋具、精品加碼促銷，還有全館來店禮、刷卡禮、滿額等多重好禮；像是4月27日~5月2日可以快樂購卡100點換100元母親節購物金；5月3日~5月8日女裝、女鞋、寢具首度單日累計滿6000元送600元抵用券；另外，這次母親節還推出許多全球獨賣、SOGO獨家、限日限量的商品。\r\n  美麗華百樂園歡慶母親節，邀請媽咪大跳百人有氧X-party！5月7日下午舉辦「動感美人」活動，凡參加活動，即可獲得價值千元的美人禮乙份。\r\n  遠東百貨母親節檔期，自4月27日~5月14日，全館當日累計滿5,000元送500元，且周周抽萬元禮券，壓軸抽汽車。\r\n  遠百表示，活動期間內，只要在全台遠東百貨當日單筆消費每滿2,000元即可兌換抽獎序號乙組，買越多送越多，最後將於北、中、南各送出一台汽車，共送出3部，分別為價值57.9萬Hyundai Verna1.6雅仕版、價值60.9萬Hyundai Verna1.6旗艦版、價值65.9萬MAZDA 2。\r\n  新光三越4月27日起展開的新光三越母親節檔期，特別針對貴賓卡友祭出4月27日～5月1日全館滿5,000送200、名品滿10,000送500；且貴賓卡綁定新光三越APP扣10點換100、銀卡扣100點換1,000現賺購物金。\r\n  微風集團母親節也推滿千送百，門檻最低滿3000送300，檔期至5月14日。\r\n',
