        content: '【時報記者任珮云台北報導】英業達(2356)今董事會後宣布發放現金股利1.45元，合計股東配發之現金股利共52.01億元。以今天收盤價22元計，現金股息殖利率為6.6%。\r\n   法人看好英業達在第2季除了在智慧行動裝置出貨持續暢旺外，來自伺服器及PC本業等產品線動能亦可期，單季營收季增和年增可望雙成長。\r\n　預期2017年度英業達在智慧裝置事業的總出貨量上看7000萬台件，業績將有兩位數成長。\r\n',
