        title: '《業績-鋼鐵》中鋼Q1稅前賺53.89億元，年增549%',
        content: '【時報記者沈培華台北報導】中鋼(2002)3月自結合併稅前淨利攀高至20.48億元，為今年來單月最佳紀錄；今年第一季自結合併稅前淨利為53.89億元，年增549%，合併每股稅前淨利約為0.34元。\r\n  中鋼第一季內銷盤價大漲12.6%，3月工作天數增加，單月合併營收達319.57億元，月增約24%，合併營業利益為21.65億元，月增1%，3月合併稅前淨利為20.48億元，月增20%。\r\n  中鋼第一季合併營收達829.84億元，年增28%；營業利益為64.33億元，年增585%；第一季合併稅前淨利為53.89億元，與去年同期的低檔8.3億元相比，大幅增加549%。\r\n  展望第二季，中鋼國內盤價平均每公噸再調漲1396元，漲幅6.9%，可望帶動第二季獲利比第一季更佳。\r\n\r\n  受到3月中以來，中國鋼價流通行情大降近100美元，使得中鋼第三季內銷盤價面臨下修的壓力；若第三季中鋼盤價開低且須降價追溯，將使得中鋼第三季獲利比第二季下滑。\r\n  預期中國大陸將持續推動「穩增長、調結構」政策，大陸的鋼鐵產業力求淘汰落後產能，短期在後續庫存去化告一段落，加上5月中旬大陸一帶一路題材下，後市並不悲觀，中鋼今年獲利仍可望較去年穩定中追求成長。\r\n',
