        title: '《半導體》義隆電：TouchPad為今年營運主力，指紋辨識H2有斬獲',
        content: '【時報記者施蒔穎台北報導】觸控晶片廠義隆電(2458)董事長葉儀皓表示，對於今年營運展望表示樂觀，筆電用TouchPad全年上看逾5000萬顆，將成為帶動今年營運更上層樓的驅動力，且指紋辨識產品已送樣多家手機大廠認證，預料下半年將有所斬獲。\r\n  義隆目前在智慧型手機用的指紋辨識產品，預估下半年將會有好消息，目前已經送樣多家手機品牌大廠，但由於指紋辨識應用於手機的相關產品售價下滑快速，因此義隆將會慎選客戶，希望維持一定毛利水準。\r\n  發言人暨處長劉代銘表示，指紋辨識產品目前占整體營收比重約2%，整體毛利率約4成，首季出貨70萬顆，其中手機和NB分別各占55%、40%，智慧卡部分由於剛起步，目前出貨占比仍低。\r\n\r\n  劉代銘進一步表示，預估第2季指紋辨識相關產品營收，可望較第1季成長1倍，其中手機和NB比重差不多，但是會略為調整，手機占比將降至約5成，NB部分則會小幅提升。\r\n  義隆電第1季毛利率為44%，預估第2季將提升至44%~46%。葉儀皓說明，以目前觀察來看，在觸控的四大應用中(Touch screen、Touchpad、手機和平板)，單價高的明顯成長，而單價低的呈現下滑趨勢，因此這也是義隆預估第2季毛利率將會較上季再提升的主要因素之一。\r\n',
        source: '時訊',
        id: 1080
