        content: '【時報記者郭鴻慧台北報導】中鼎(9933)集團獎不停，集團的印度公司(CINDA)獲印度營建產業發展局頒發CIDC Vishwakarma Award安衛環獎項，此外，集團也榮獲馬來西亞國營石油公司(PETRONAS)頒發工程進度領先及最佳安全承攬商等多項大獎。\r\n\r\n  中鼎集團承攬馬來西亞國家石油公司(PETRONAS)邊加蘭大型綜合開發計畫(Pengerang Integrated Complex, PIC)之重油觸媒裂解專案(RAPID Package 1 RFCC, LTU, PRU Project，以下簡稱P1)，因優異的EPCC統包工程整合與執行能力，及現場安全衛生管理成效，榮獲業主於2月頒發「最佳安全承攬商」與「最佳安全區域」兩項大獎，並親授感謝狀表揚P1專案持續領先之工程進度。此外，該專案團隊成功地將目前馬國最重、2000噸之兩個模組化廢熱鍋爐於台灣先行組裝，並如期運抵工地安裝，亦於3月21日獲得業主頒發感謝狀予以肯定。\r\n  中鼎集團印度公司(CINDA)，承攬印度國營機構拉馬古恩達姆肥料化學公司(RFCL, Ramagundam Fertilizer & Chemical Ltd.)Ramagundam Fertilizer Plant Civil Work for U&O Package專案，榮獲印度營建產業發展局頒發CIDC Vishwakarma Award安衛環獎項。頒獎典禮已於3月7日假印度新德里環境中心舉行，CINDA公司總經理林天生及業務經理劉國瑞代表公司接受頒獎。本獎項堪稱國家級獎項，由印度營建產業發展局主辦，特以表彰對於印度國內工程產業具有貢獻的企業。\r\n',
