        title: '《業績-半導體》力成Q1獲利年增24%，每股賺1.5元',
        content: '【時報記者林資傑台北報導】記憶體封測廠力成（6239）今日召開法說會，公布2017年首季財報，首季合併營收126.6億元，季減7.3％、年增19.2％，創同期新高。毛利率21.8％、營益率16.2％，雖因步入淡季而略低於去年第四季的16.4％，但顯著優於去年同期的19.4％、13.7％。\r\n　雖因新台幣強升拖累業外虧損較去年同期倍增，但力成在本業營運提升下，歸屬業主稅後淨利11.66億元，雖因步入淡季而季減18.9％，但仍年增達24％，基本每股盈餘1.5元，低於去年第四季的1.84元、優於去年同期的1.21元。\r\n\r\n　力成財務長兼發言人曾炫章表示，首季營收下滑主要由於步入季節性淡季、工作天數較少影響，但毛利率表現持穩，為2011年以來近5年同期新高，主要受惠於產品組合改善。受到匯損影響，首季業外虧損擴大至2.95億元，較去年同期虧損1.36億元倍增。\r\n　觀察力成首季業務狀況，占76％的封裝業務雖季減11.1％、仍年增23.4％，占24％的測試業務季增7.5％、年增7.8％。以產品種類觀察，DRAM業務季減13.7％、年增19.4％，Flash業務季增1.8％、年增31.7％，邏輯業務季減12.1％、年增2.6％。\r\n　力成總經理洪嘉(金俞)表示，首季適逢傳統淡季加上匯損逆風，使許多公司經營得很辛苦，但力成首季表現還算不錯，表現也達到預期目標，主要由於FLASH業績維持高檔，甚至比去年第四季續揚，彌補DRAM、邏輯業務因繪圖記憶體、手機等應用需求轉淡的下降。\r\n',
