        title: '《電子零件》亞泰Q2營收估季增2成，新品出貨H2添柴',
        content: '【時報記者張漢綺台北報導】全球第二大CIS廠—亞泰影像(4974)公布第1季季報，每股盈餘為0.72元，亞泰總經理吳淑品表示，從客戶端來看，預估第2季營收將較第1季成長20%，較去年同期成長10%，毛利率有機會較第1季成長，公司持續開發各項新產品，其中掃地機器人的感測模組將於第3季開始出貨，而應用於人體體液細胞追蹤分析的醫療用鏡頭預計於今年第4季正式生產出貨，成為推升公司營運成長的新動能。\r\n\r\n　亞泰第1季合併營收7.35億元，年成長57%，營業淨利約7400萬元，季增約10%，年增率為734%，主要是因營運規模擴大、管理績效提升，以及緬甸廠效益發揮，帶動毛利率及淨利率攀升所致，雖然新台幣兌人民幣及美元升值，認列約1900萬元匯兌損失，但單季稅後盈餘約4700萬元，較去年同期成長2490%，每股盈餘0.72元。\r\n　吳淑品表示，亞泰擁有光機電整合能力及半導體封裝技術，目前全球前五大多功能事務機有4家是公司客戶，公司亦應用影像感測技術優勢，積極拓展多角化產品，其中金融辨識產品已開始出貨，約占公司營收0.5%，而公司新開發的掃地機器人的感測模組將於第3季開始出貨，應用於人體體液細胞追蹤分析的醫療用鏡頭預計於今年第4季正式生產出貨，成為推升公司營運成長的新動能。\r\n　從目前訂單來看，吳淑品表示，第2季合併營收將較第1季成長20%，和去年同期相較，亦可望成長10%，毛利率亦有機會較第1季成長。\r\n　在緬甸廠部分，由於大陸東莞缺工嚴重，美國及日本客戶希望緬甸廠能持續擴充產能，亞泰計畫將深圳廠的設備陸續移至緬甸，預計今年緬甸廠月產能將增加30萬套，達90萬套，今年底緬甸廠加深圳廠年產能將達2700萬套。\r\n',
        source: '時訊',
