        title: '《光電股》亞光天量收小紅',
        content: '【時報記者張漢綺台北報導】光學元件廠—亞光(3019)因車載鏡頭、瞄準器、雷射測距儀及數位相機出貨穩定成長，公司樂觀看待今年業績，今天亞光股價一度帶量攻高，不過尾盤時在光學元件多開高走低下，亞光以小漲作收，但成交量56183張，創下公司新天量。\r\n\r\n　亞光以玻璃鏡頭起家，早期以數位相機鏡頭及組裝業務為主，受到數位相機市場年年衰退影響，亞光營運也陷入谷底，不過公司一步一腳印，以自家玻璃技術，深耕車載鏡頭、智慧家庭及醫療等新應用，由於車載鏡頭必須通過嚴酷的環境考驗，符合抗高溫酷寒、耐震、防水等要求，因此多以玻璃為主，並搭配「非球面模造玻璃」，這正是亞光的強項，加上公司紮根許久的「雷射測距技術」，成為亞光車載鏡頭搶進ADAS(先進駕駛輔助系統)及自動駕駛的利器。\r\n　事實上，亞光生產瞄準鏡、測距儀等產品的菲律賓廠一直是亞光集團的金雞母，過去雷射測距技術應用以軍事及狩獵為主，由於ADAS強調防撞、主動偵測及自動停車等，「雷射測距技術」變得十分重要，亞光因「雷射測距技術」獲得肯定，成為Tesla等車廠開發ADAS及自駕車鏡頭競相合作的光學鏡頭廠。\r\n　目前亞光車載鏡頭產品5G到7G產品皆有，產品包括車載鏡頭及HUD(抬頭顯示器模組)等，其中車載鏡頭部分，公司透過日本廠出貨給歐洲車廠，去年單月出貨量已從原本的30萬顆增加至50萬顆，出貨給Tesla的車載鏡頭單月出貨量亦已有2萬顆到3萬顆；亞光亦開始與Tesla合作開發自動駕駛系統鏡頭，亞光預估，今年車載鏡頭單月出貨量將從去年的50萬顆攀升至60萬顆，明年起更可望展現強勁爆發力。\r\n  值得一提的是，亞光的雷射測距技術，亦與小米合作，日前在台灣正式發表「米家掃地機器人」，正是採用亞光「雷射感測模組」，目前單月出貨量可達7萬台到10萬台，隨著車用自動駕駛及智慧家庭應用激增，「雷射感測模組」可望成為亞光業績成長重要動能。 \r\n　亞光3月合併營收為14.39億元，年成長11.48%，累計第1季合併營收為37.66億元，年成長6.9%；在車載鏡頭、瞄準器、雷射測距儀及數位相機出貨穩定成長下，亞光樂觀看待今年業績。\r\n',
