        title: '《半導體》敦泰Cover方案，Q2品牌用戶端量產',
        content: '【時報記者施蒔穎台北報導】指紋辨識應用自2016年起快速成長，敦泰(3545)積極布局此應用領域商機，近期傳來捷報，其Cover方案即將於第2季在品牌用戶端進入量產，顯示在電容式指紋方案有了新的突破，敦泰對於指紋辨識產品的開拓表示有決心，也有信心爭取更大的市場占有率。\r\n  敦泰不僅實現了Coating產品在品牌用戶端批量量產的實績，同時也推出了Cover(玻璃、陶瓷、藍寶石)方案，公司指出，國內外指紋IC廠商能夠實現LGA封裝Cover方案的廠商屈指可數，技術難度可見一斑。\r\n\r\n  敦泰在指紋辨識晶片領域，具備完整的產品線，完善的電容偵測及指紋專利，並和瑞典PB客制化深度合作，在演算法專利上為客戶保駕護航，並將指紋解鎖速度壓縮到120ms，完全滿足國內外一線品牌客戶要求。\r\n  敦泰指出，結合自主指紋Force Touch技術，第一代Cover方案就提供指紋解鎖、Force Touch、手勢導航、觸摸按鍵功能四合一的創新應用。另外，通過不斷探索研究，採用軟硬體相結合的方式，實現手指智慧檢測，在主機不參入的情況下，低功耗模式下防止誤觸發。\r\n  敦泰積極拓展指紋辨識產品，近日於深圳舉辦新產品發表會中，展示了指紋識別(電容式及光學式)方案，此次重磅推出aTOM光學指紋技術，提供技術領先業界的UnderGlass和TouchON兩種創新產品方案與開發平台。\r\n  敦泰指出，aTOMUnderGlass系列採用世界獨家專利架構、革命性微型光機電指紋晶片技術，是全球第一個提供500um~1100um厚度玻璃下能清晰取讀高達1016 dpi指紋資訊，同時具備免挖盲孔/貫孔、組裝容易、活體與假指紋偵測等獨特性能優勢，並已擁150多項國內外核心專利，將能幫助手機廠商同時滿足高屏占比需求、高度客制差異化、並為手機客戶快速導入量產的UnderGlass指紋晶片方案。\r\n  敦泰進一步表示，aTOMTouchON系列則依應用提供了世界最輕薄0.45mm或高性價比0.63mm的微光機電指紋晶片方案。是目前業界獨一能兼備支持超輕薄(0.45mm)、高靜電防護(>30KV)、高省電(<1.4mA)、真假指紋偵測、非侵入式生理信息量測等客制化功能，提供予新一代智慧卡、手機、IOT與穿載式應用的前瞻指紋識別晶片全方位解決方案。上述兩個aTOM系列產品都將在今年第2季起提供量產支援。 \r\n  隨著小米MIX、LG G6、三星Galaxy S8/S8+等全面屏手機的推出，“全面屏/高屏占比”成為2017智慧手機流行趨勢關鍵字，敦泰產品涵蓋LCD/AMOLED顯示驅動晶片、2D/3D觸控晶片、In-cell單晶片（IDC）、電容指紋晶片，而此次光學指紋技術的發佈則進一步強化了產品優勢，敦泰相信必將在這場由以螢幕為核心點的智慧手機配置升級戰中，創造更加強勁的創新助力。\r\n',
