        title: '《電子零件》Q2不淡、買盤挺，健策漲停',
        content: '【時報記者張漢綺台北報導】健策(3653)受惠於LED車燈及車用散熱產品佈局發酵，今年第1季合併毛利率達28%，較去年同期增加5.29個百分點，為103年第2季以來單季新高，營業淨利達1.17億元，年成長73.9%，但受到新台幣兌美元急升，認列匯兌損失影響，健策第1季每股盈餘為0.05元，由於第2季起，LED車燈等出貨放量，健策第2季業績不看淡，今年車用產品占營收比重可望達30%，在買盤進場下，健策今天無畏匯損利空，盤中股價強攻漲停板。\r\n\r\n　健策主要產品為均熱片及導線架，早期應用以PC相關為主，後來逐漸跨入LED照明、遊戲機、智慧型手機等，其中車用LED燈部分，公司長期與歐司朗合作，目前已站穩如：儀表板及煞車燈低功率車用LED燈市場，而公司新開發用於大燈的中功率LED車燈亦將於今年第2季開始量產出貨，由於車用LED燈需求強勁，歐司朗近期擴大對健策下單，讓健策今年業績看俏。\r\n　健策第1季合併營收為8.91億元，年增10.55%，營業毛利為2.49億元，年成長36%，合併毛利率達28%，較去年同期增加5.29個百分點，為103年第2季以來單季新高，營業淨利達1.17億元，年成長73.9%，但受到新台幣兌美元急升，認列匯兌損失影響，稅前盈餘為726萬元，稅後盈餘為522萬元，每股盈餘為0.05元。\r\n　在車用散熱部分，健策攜手國際半導體大廠，積極投入車用IGBT散熱產品研發，經過約3年的開發，終於開始進入收割期，並正式通過國際大廠認證，預計將於下半年開始出貨，正式跨入電動車及油電混合車市場。\r\n　去年車用產品占健策營收比重約25%，在車用LED燈出貨穩定成長，以及IGBT散熱器可望自下半年開始出貨下，健策預估，今年車用產品占營收比重可望拉升到30%。 \r\n　由於第2季有雲端伺服器新產品開始出貨，下半年又有IGBT散熱器等車用新產品，健策預估，今年業績將逐季成長，全年獲利將明顯優於去年。\r\n　健策今年亦計畫大手筆投資6億元於兩岸擴產，除增建廠房及產線，亦將增購大型鍛造母機及EMC製程LED機台，以因應車用產品需求。\r\n',
