        content: '【時報記者施蒔穎台北報導】面板驅動IC大廠聯詠(3034)股利分配案出爐，董事會決議每股將配發新台幣7元現金股息，將於6月7日股東常會討論配股案，殖利率逾6%，激勵今日股價小幅開高，盤中漲幅約2%。\r\n  聯詠去年合併營收滑落至456.51億元，年減10.26%，稅後淨利50.04億元，年減21.8%，每股純益8.22元。聯詠延續前二年配發獲利85%的股利政策，今年決議每股擬配發7元現金股利，若以昨天收盤價111元計算，現金殖利率6.3%。\r\n  聯詠第1季營收達109.19億元，符合原先法說預期，惟新台幣升值因素影響，對於首季獲利恐造成部分衝擊，該公司預估第1季毛利率將介於27~28.5%，營益率約10.5~12%。\r\n\r\n  聯詠主要產品線為TFT LCD驅動IC，該公司先前預估電視系統單晶片(SoC)出貨量將與去年第4季持平，大尺寸驅動IC則是季減。\r\n  展望未來，法人表示，隨著今年4K2K LCD TV滲透率持續增加，將帶動大尺吋驅動IC出貨量成長，也預期今年LCD TV控制晶片出貨量將優於去年表現。\r\n  此外，隨著中高階智慧型手機要求更高的解析度、更薄的設計，TDDI晶片將蔚為一股風潮，面板廠相繼推出搭載TDDI IC的In-Cell產品，市場能見度將於今年大開，而聯詠的整合觸控功能面板驅動IC(TDDI)已於第1季小量出貨，估計第2季放量成長，可望為帶動今年業績成長的新動能。\r\n',
