        datetime: '2017-04-25T11:41:12',
        title: '《其他電子》普安推桌上型儲存系統',
        content: '【時報記者張漢綺台北報導】普安科技(2495)今天宣布，針對小型企業、小型辦公室和特定工作群組，推出整合SAN、NAS和雲端且可提供更簡易的跨平台多業系統檔案分享的EonStor GSe Pro 2000儲存系統。\r\n\r\n　由四核心處理器、內建10GbE連接埠的EonStor GSe Pro 2000可以為像是伺服器虛擬化、影像編輯、備份，和電子郵件伺服器等對每秒資料流(IOPS)等流通量具有高需求的應用程式提供絕佳的資料傳輸性能，另外也可透過各種擴充槽或外接裝置與各式各樣的主機連接埠連接，如1 GbE RJ45、10GbE RJ45、10GbE SFP+、8Gb FC，和16Gb FC等等，具有亮麗金屬外型設計和超靜音特性的這台桌上型儲存系統，是為對空間和價格因素特別重視的小型企業、小型辦公室和特定工作群組而設計的。\r\n　普安表示，EonStor GSe Pro 2000支援跨平台CIFS/SMB、NFS、AFP和FTP檔案分享，以精簡資料分享和存取的過程；並內建雲端閘道引擎，以整合像是Google Cloud、Dropbox，和阿里雲等私有和公用雲端服務，讓使用者可以利用雲端來做容量擴充、資料建檔及備份。\r\n　值得一提的是，結合儲存設定，控制及管理的EonOne軟體，可將儲存配置以及像是快照等等的備份行程排定，將繁複的設定及管理流程簡化成方便好用的步驟程序。系統也內建了包含LDAP、Proxy、Syslog和VPN伺服器以及防毒軟體等多種服務，為使用者提供更多的價值和好處。\r\n',
        source: '時訊',
