        content: '【時報記者沈培華台北報導】記憶體模組大廠威剛科技(3260)第一季在淡季中逆勢交出亮麗的財報，單季EPS 3.62元為近4年新高，股價跳空開高漲2.8元，以71.7元開出，緩和董事長賣股的利空。\r\n  威剛董事長陳立白申報持股轉讓2,500張威剛持股，致周一股價開低2.7元為70元，今早股價最高72.4元，幾乎全數回補本周一之跳空缺口，三大法人周一聯袂賣超約2500張。\r\n  威剛周一下午公布季報，2017年第一季營收及獲利雙雙逆勢走揚，優於去年第四季，單季每股稅後盈餘3.62元為近4年新高。公司看好在上游廠商新製程量產進度落後，智慧型手機等新品上市備貨需求下，DRAM及NAND Flash缺貨態勢將持續至今年下半年。\r\n\r\n  威剛科技今年第一季營收在DRAM及NAND Flash兩大記憶體持續漲價帶動，月營收逐月走揚，單季營收年增率64.58%站上80億元，創近13季新高；單季毛利率也較去年同期的7.15%大幅改善，增加11個百分點達18.19%，加上公司第一季匯損相對有限，母公司業主淨利大幅躍升554.7%達7.87億元，單季每股稅後盈餘3.62元，較去年第四季的3.6元微增。\r\n',
