        datetime: '2017-04-25T09:09:36',
        title: '《水泥股》躍升台泥最大股東，嘉泥漲逾2%',
        content: '【時報記者郭鴻慧台北報導】嘉泥(1103)將躍升為台泥(1101)最大股東，多頭拍手歡慶，今日股價跳空開高，晨盤漲幅超過2.2%。\r\n  嘉泥選擇以0.42的換股比例，將所持有的台泥國際股票轉換為台泥新發行股票，合計將取得20.52萬張台泥普通股，加上原本持有約5.6萬張台泥，換股之後將增至26萬多餘張，占5.9%，超過國泰人壽成為台泥法人第一大股東。\r\n  嘉泥指出，此次採轉換台泥普通股的方式，主要考量將持續參與台泥在中國大陸市場布局，未來也可兼顧其他市場及產業的投資機會，並改善整體策略性持股的流動性及現金股息收益率。\r\n',
        source: '時訊',
