        title: '《通信網路》正文Q1獲利增近3倍，法人續看好Q2',
        content: '【時報-台北電】正文（4906）轉型成功，首季獲利大爆發，經結算單季稅後盈餘1.89億元，較去年同期成長293％，每股稅後盈餘0.63元，創下IFRS以來單季次高，表現僅次於去年第三季的0.7元。\r\n　雖然首季有台幣急升的匯損壓力，但是正文新結算出來的首季財報靠著本業發威，卻絲毫感受不到匯損的影響，經董事會通過，今年首季營收38.8億元雖僅較去年成長25.9％，但因為LTE以及智能新產品出貨增溫，毛利率也揚升至16.43％，較去年同期的15.19％，上揚1.24個百分點，反映在獲利上，表現更是令人驚奇，經結算單季稅後盈餘1.89億元、每股稅後盈餘0.63元，年增近3倍。\r\n\r\n　受到此利多帶動，正文昨（24）日股價開高走高，以29.8元再創波段新高，終場收在29.35元、單日漲幅6.53％，在多方猛力搶進下，該股昨日爆出15,606張大單，成交量也同步創下今年新高。\r\n　正文董事長陳鴻文去年底召開法說會時曾提及，未來正文將朝向高附加價值、系統性及改變商業模式三大發展，以往接單都著重在硬體、且多半是OEM單的狀況將成為過去式，未來正文將推出更多系統整合的產品，朝軟硬合一前進。\r\n　法人指出，正文首季表現淡季不淡，透露出今年業績轉旺的訊息，由於第二季起進入網通產業旺季，預料第二季仍可望有季增的表現。\r\n　雖然去年正文高毛利的系統整合產品占比僅一成，但隨著占比的提高，已反映在毛利率上，法人指出，就正文今年首季的表現言之，包括LTE以及智能新產品出貨都持續在增溫中，其中IOT產品預期下半年出貨量還會再放大，今年全年營運仍有逐季成長的可能，全年營收有機會成長近二成，毛利率守住15％，應是輕而易舉。（新聞來源：工商時報─鄭淑芳／台北報導）\r\n',
        source: '時訊',
