        title: '《電子通路》燦坤開設快3快閃店，瞄準outlet商機',
        content: '【時報記者施蒔穎台北報導】燦坤(2430)鎖定outlet商機，快3網路商城首間「燦坤快3快閃店」開設於台北內湖總部旗艦店，燦坤表示，未來將不定時、不定點的舉辦「燦坤快3快閃店」，預估快閃店可望為燦坤快3帶來單月兩位數的業績成長。\r\n  「燦坤快3快閃店」即日起一個月內在燦坤內湖總部旗艦店一樓開設，占地上百坪，成為全台規模最大的3C家電Outlet。燦坤指出，「燦坤快3快閃店」集結眾多人氣3C家電官方翻新品、福利品，以最低價格下殺2折起，如Dyson吸塵器、氣流倍增機；SONY、LG等一線大廠的4K電視；現場甚至有近百台萬元有找的筆電，因此吸引消費者上門搶購。\r\n\r\n  燦坤表示，觀察台北內湖因聚集眾多大賣場及outlet，而吸納北台灣消費人潮群聚效應以及驚人的消費力。加上總部旗艦店一樓空間足夠集結眾多的3C家電官方翻新品、福利品送至現場展示販售，未來也將不定時、不定點的舉辦「燦坤快3快閃店」，可望促進業績再增長。\r\n',
