        title: '《半導體》創意任命新系統首席技術長，強化ASIC服務',
        content: '【時報記者施蒔穎台北報導】客製化ASIC廠創意(3443)委任半導體產業專家Igor Elkanovich為系統首席技術長(System CTO)，未來將致力於提升GUC系統應用端的領域知識。\r\n  創意表示，Elkanovich先生擁有廣泛豐富的多元系統知識和30年的產業經驗，曾擔任許多創新公司的技術領導職務。近期，在擔任Verisense CTO的期間裡，他成功帶領了使用先進製程技術的複雜SoC的研發。\r\n  而在之前，他曾擔任VLSI副總，以及在Broadlight(由Broadcom併購)、Infineon、Mysticom(現為Cadence一部分)和Motorola Semiconductors(Freescale)擔任管理職務。\r\n\r\n  創意總經理陳超乾博士表示，創意的策略目標是針對高階系統公司客戶，擴展其ASIC服務。我們邀請Igor Elkanovich加入GUC擔任CTO，協助對系統終端產品的架構及應用的了解、進而改善設計驗證的方法與流程，並確保公司IP產品規格符合系統客戶需求。\r\n  Igor Elkanovich表示，此時加入創意可謂恭逢其盛。我們正致力於執行TSMC 16nm、12nm、和7nm先進製程技術的專案，也已發展出針對各式應用的完整IP組合，且不斷地累積豐富的製造經驗，個人目標不僅是要提供客戶最好的產品，更要同時專注於客戶的系統優化。\r\n',
