        title: '《證交所》證券商財富管理信託規模，3月再創新高',
        content: '【時報記者莊丙農台北報導】根據台灣證券交易所統計，證券商財富管理業務信託資產規模3月再創歷史新高，至3月底達新台幣1,381億元，比今年初信託資產規模1,339億元成長3.1％，亦較去年同期1,133億元成長21.8％，顯示券商財富管理業務穩健成長趨勢，投資人可藉由證券商在投資專業上的強項，投資國內外各項金融產品。\r\n　證交所表示，信託資產規模中金錢信託金額約為998億元，約占72％，主要投資標的為國內外基金商品；有價證券信託金額約為382億元，約占27％，皆屬有價證券出借，投資人可藉由有價證券信託出借其長期投資的股票，增加投資報酬率。\r\n\r\n　證交所券商輔導部表示，國泰金(2882)旗下國泰證券於今年2月開辦信託業務後，目前共有11家證券商以信託方式辦理財富管理業務，累積有效開戶數已達25萬戶以上，登記財富管理業務證券商從業人員亦超過12,000人，主要因主管機關於102年開放證券商受託買賣業務人員兼任財富管理人員，許多營業員開始轉型取得財富管理人員資格，提供客製化的理財服務，提升證券商從業人員附加價值。\r\n',
