        content: '【時報記者郭鴻慧台北報導】嘉泥(1103)支持台泥國際私有化，將選擇以0.42的換股比例，將所持有的台泥國際股票轉換為台泥(1101)新發行股票，合計將取得20.52萬張台泥普通股，加上原本持有約5.6萬張台泥，換股之後將增至26萬多餘張，占5.9%，超過國泰人壽成為台泥法人第一大股東。\r\n  嘉泥執行副總王立心表示，嘉泥臨時董事會經內外部專業團隊審慎評估，考量股東權益最大化，已決議支持該協議計畫，並選擇交換台泥新發行的普通股，交換後將取得台泥普通股股票約20.5萬張。若加上嘉泥5.6萬張台泥，成功換股後，嘉泥持股比將從原本1.5%增至5.9%。\r\n\r\n  嘉泥指出，此次採轉換台泥普通股的方式，主要考量將持續參與台泥在中國大陸市場布局，未來也可兼顧其他市場及產業的投資機會，並改善整體策略性持股的流動性及現金股息收益率。\r\n',
