        title: '《其他股》綠悅喊話，董座申讓持股無損股東權益',
        content: '【時報記者王逸芯台北報導】中國最大BOPA綠悅-KY(1262)昨(24)日因傳出董事以他人名義持有股權申請轉讓一事，衝擊股價跌停鎖住，公司緊急發出聲明滅火指出，本次持股轉讓申報人為董事長王哲夫的個人投資公司，此次申報轉讓7544張，約占5%，屬於個人財務操作，在轉讓後，董事長持有綠悅股權為36%，仍是公司第一大股東，此次僅為個人財務規劃，無損股東權益，綠悅強調，公司基本面樂觀，BOPA市場依舊呈現供不應求。\r\n\r\n  綠悅-KY針對公司董事以他人名義持有股權申請轉讓一事做出以下三點說明：\r\n  一.申報人「國泰世華商業銀行受託保管啟豐國際有限公司投資專戶」身份，為董事長王哲夫的個人投資公司，此次申報轉讓7544張，約占5%，屬於個人財務操作，在轉讓後，董事長持有綠悅股權為36%，仍是公司第一大股東。\r\n  二.此次轉讓為董事長個人財務操作，採鉅額逐筆交易，並已於2017年4月24日全數轉讓完畢，且受讓人為長線投資交易對象，並不影響股東權益。\r\n  三.公司目前財務及營運狀況均屬良好，且中國BOPA（雙向拉伸尼龍）薄膜整體市場亦呈現供不應求情況，公司未來持續提高客製化產品比重與擴增產能的計畫不變，預計今年全年客製化產品EHA出貨量可超過3000噸，並將於今年第四季安裝第三條磁懸浮生產線（第九線）。\r\n',
