        title: '《營建股》台開談建築，丹麥BIG創辦人主講永續享樂主義',
        content: '【時報記者郭鴻慧台北報導】台開(2841)集團舉行「TIDC花蓮論壇-國際大師與你談夢想系列論壇」，BIG集團創辦人暨創意總監比亞克．英格爾(Bjarke Ingels)在此論壇上分享設計概念-永續享樂主義。台開集團董事長說，與丹麥BIG合作始於2009年，看到大家的夢想即將在台灣實現，永續是連接國際成為國際的一份子，如何永續享樂是我們的夢想，正向看著我們的未來，不要悲觀。\r\n  英格爾指出，價值挑選的標準，作為設計上的決定，建案標準與要解決的問題是什麼，務實的考量用建築設計來解決問題，以丹麥高中運動場館為例，設立在中間很浪費空間，後來在地底下，屋頂設計根據數學拋物線曲線公式，中庭變成天窗綠地，吸引很多人到這裡來。\r\n\r\n  英格爾指出，一個建築物與在地氣候的關連，用在地的取材，來做建築的條件，希臘屋頂建築很平，晚上可以乘涼，愛斯基摩圓的雪屋很保暖等，現在不是要回到500年前生活，是要強調在地建築化2.0，用現在科技演算氣候等運算，因為設計的良好，不需要仰賴過多的設備機器。\r\n  英格爾表示，因邱復生董事長，認識花蓮洄瀾灣，有海有山有美麗得稻田，建立新的生活方式，跟許多好朋友住在一起分享，也可以有自然的景觀，把建案帶到設計上，所以有斜屋頂，且看日出日落點，利用太陽能。\r\n  英格爾表示，台開花蓮日出山莊建築像水墨畫的山型建築地景，每一棟山型建築有綠地空間，可以運動可以跑步，並可降低氣溫，不僅有美學的效果，更有微氣候的環境，住在這裡非常宜人，有山水畫的景象，也可以有溫暖的居住空間，在日出山莊看到每個建築房子都很有個性，可以隨時到戶外，設計有點像台灣與北歐，有充足的綠景空間，結合傳統台灣與丹麥的元素，創造另外一個新生活元素。\r\n',
        source: '時訊',
