        title: '《證交所》外資上周賣超台股89億元，中壽最受傷',
        content: '【時報記者莊丙農台北報導】外資台股買盤在清明連假後退卻，上周進一步轉為賣超，也是連續買超5周以來首次單周賣超。根據台灣證券交易所統計，上周外資在集中市場總買進金額為1026.44億元，總賣出金額為1115.44億元，累計賣超89.00億元。累計今年以來至4月21日止，外資總買進金額為1兆8227.97億元，總賣出金額為1兆6587.12億元，累計買超為1640.85億元。\r\n　外資總持有股票市值為11兆6864.20億元新台幣，占全體上市股票市值的40.74％，較4月14日的11兆6715.97億元新台幣增加148.23億元。\r\n\r\n　在個股部分，上周外資在集中市場買超最多的一檔是旺宏(2337)，總計買超2萬974張，其次是群創(3481)，買超1萬9685張，台灣高鐵(2633)買超1萬9358張排第三。\r\n　賣超部分，中壽(2823)居上周賣超之冠，總計賣超3萬966張，台積電(2330)、富邦金(2881)居賣超第二、三大，張數分別為3萬204張及2萬9802張。\r\n',
