        content: '【時報-台北電】嘉泥(1103)今日發出重訊指出，有關台泥與TCC \r\nInternational Limited(下稱「TCCI」)共同以協議計畫(Scheme \r\nof Arrangement)方式私有化台泥國際集團有限公司(下稱「台泥國\r\n際」)之要約案，嘉泥董事會決議支持該協議計畫，並選擇交換「\r\n台泥」新發行之普通股(換股比例為每一股「台泥國際」普通股股\r\n份可交換0.42股「台泥」新發行之普通股)。\r\n  嘉泥及子公司Chia Hsin Pacific Limited分別持有「台泥國際\r\n」普通股股份882萬9262股及4億7984萬9250股，約計分別占「台泥\r\n國際」已發行普通股股份總數49億4348萬9851股之0.18%及9.71%。\r\n  嘉泥董事會進一步決議授權董事長及其指定之人全權處理本案後\r\n續相關事宜，及簽署一切必要相關文件(包括The letter of \r\nirrevocable undertaking)等。該協議計畫應取得香港聯交所及英\r\n屬開曼群島法院等核可。(編輯整理：李慧蘭)\r\n',
