        content: '【時報-台北電】亞德客-KY(1590)公告第一季度自結合併財務報表。亞德客-KY表示，由於市場需求回溫，公司持續開發新產品、擴展銷售通路與增加新客戶來提高市場佔有率，亦不斷優化生產效率及經濟規模來提升利潤率。亞德客-KY第一季EPS為新台幣3.5元。\r\n\r\n  亞德客-KY第一季自結合併營業收入淨額為人民幣6.21億元，年增38%，若以新台幣計價為28.14億元，年增24%；營業毛利為人民幣3.19億元（毛利率為51.45%），年增42%，若以新台幣計價為14.47億元，年增27%；營業利益為人民幣1.81億元（營業利益率為29.15%），年增77%，若以新台幣計價為8.2億元，年增58%；稅前淨利為人民幣1.84億元（稅前淨利率為29.74%），年增53%，若以新台幣計價為8.37億元，年增37%；合併稅後淨利為人民幣1.38億元（合併稅後淨利率為22.27%），年增59%，若以新台幣計價為6.26億元，年增42%，其中非控制權益淨利為新台幣18萬元，集團稅後淨利為新台幣6.26億元（集團稅後淨利率為22.26%），EPS為新台幣3.5元。(編輯整理：李慧蘭)\r\n',
        source: '時訊',
        id: 1362
