        title: '《電子零件》鴻名：今年營收可望兩位數成長',
        content: '【時報記者張漢綺台北報導】鴻名(3021)自去年開始組織調整，強化「線材連接器」及「系統整合」兩大事業群專業分工，其中「系統整合」因強化服務解決能力，預估今年「系統整合」營收將上看5億元，「線材連接器」則因車用、事務機及家電等產品穩定成長，鴻名預估，今年營收可望較去年兩位數成長。\r\n\r\n　鴻名自去年開始組織調整，強化「線材連接器」及「系統整合」兩大事業群專業分工，其中「線材連接器」已站穩日本家電、事務機供應鏈，公司亦積極跨入車用領域，包括汽車倒車雷達及車燈等，去年線材連接器營收約14.65億元，年成長6.7%，近年來因中國生產成本提高，日商擴大東南亞生產基地，鴻名緊跟客戶腳步，在菲律賓配合客戶量產，去年菲律賓廠小賠，預估今年菲律賓廠將會轉虧為盈。\r\n　在「系統整合」方面，系統整合部門去年營收4.42億元，系統整合事業部總經理林嘉祥表示，由於主要產品服務集中在資訊軟硬體產品、解決方案及資訊系統維護為主，公司近二年非常重視Service服務，並著墨醫療、外資企業及金融事業等，其中硬體銷售首季約1.2億元水準，在系統整合方面佔比約四成，對毛利率貢獻則約60%，預估今年將逐季成長，全年營收上看5億元。\r\n　就去年營收來看，「線材連接器」及「系統整合」各約佔77%與23%。\r\n　若以產品應用來看，家電約佔30%到35%、事務機約佔20%到25%、IT產品約佔10%到20%、車用約佔15%到20%、工具機約佔3%到5%及其他5%到10%。\r\n　鴻名2016年合併營收為19.07億元，年成長7.3%，稅後盈餘為1.05億元，每股盈餘為1.05元，為近5年來最佳，公司董事會決議每股配發現金股息0.7元，現金殖息率約5.4%。\r\n　鴻名主要生產據點以華東的上海展升電子及昆山羿冠電子為主；華南則有深圳展升及惠州展茂電子為主。\r\n',
