        title: '《通信網路》2G退場倒數，遠傳祭升級優惠',
        content: '【時報記者王逸芯台北報導】台灣電信業2G退役終止服務是今年一大重要事件，眼看的時間逼近，遠傳(4904)今日宣布，祭出攜碼/續約4G優惠方案，即日起至6月底止，凡至遠傳/全虹門市申辦2G升級4.5G，月租只要99元起，還有多款精選手機0元起，最高再送7500元通話優惠，專案優惠總價值高達1萬2500元，再享免費上網1GB起，目前市場上仍存著逾30萬的2G用戶，其中又以電信龍頭中華電(2412)為數最多，遠傳目前則不到3萬戶。\r\n\r\n  根據資策會創新應用服務研究所(創研所)FIND針對銀髮族的一項調查指出，台灣銀髮族人口（55歲以上）智慧型手機持有率達60.2%，顯示使用智慧型手機上網已不再是年輕人的專利，遠傳推出的2G升級4.5G優惠方案特別精選多款機型，申辦指定方案搭配手機只要0元起，抓準現今2G用戶本就為低網路需求族群，可以讓其用和2G類似、甚至更加優惠的價格，體會行動網路。\r\n  因為現行2G設備都已經老舊，非常耗電、耗能，據估計，光是2G的服務就占台電總發電量0.1%，2G頻譜6月底即將到期，為降低「釘子戶」問題的衝擊，目前各家電信業者都積極鼓勵用戶升級，此可以說是一舉兩得，不僅可以解決「釘子戶」問題，還可以增加4G用戶數。\r\n  遠傳表示，2G用戶無論是攜碼或續約現在申辦遠傳2G升級4.5G優惠方案，月付只要99元起，即享通話費回饋及上網等優惠，申辦攜碼/續約指定方案最高可享有7500元通話優惠；攜碼還可再享任一網外費率以網內計價；續約加碼優惠則享前6個月當月帳單金額優惠100元，而續約指定方案其優惠總價值高達1萬2500元。\r\n',
