        title: '《半導體》盛群營收，Q2續看增、全年得看匯率',
        content: '【時報記者沈培華台北報導】微控制器(MCU)廠盛群(6202)第一季營收創下歷史單季新高，第二季在馬達控制、健康量測、小家電出貨仍穩定，第二季營運看法仍偏正向，預期將優於去年同期，年增及季增幅度預估都約為5~10%。今年營運最大的變數就是台幣匯率。\r\n  盛群今年第一季大陸業績成長二成，加上小家電、馬達控制持續拉貨，使得首季營收與去年第四季相當，淡季不淡，且年增達19.6%，若不計台幣兌美元急升的匯率不利影響，今年首季營收年增率約25%。\r\n\r\n  展望第二季，預期健康量測、煙感、小家電及馬達控制等產品出貨仍穩定，使得第二季營收可望相較去年同期仍成長，年增約5~10%；但因首季基期已高，因此預估今年第二季營收季增也在5~10%之水準，相較以往第二季比第一季增長多在15~20%，今年第二季的季增幅度漸緩。目前預估第二季台幣仍在目前水準附近，單季毛利率預估在46~47%。\r\n  盛群今年第一季營收創單季歷史同期新高，但受到單季匯損2900萬元創新高，單季淨利季減1成。展望全年，在第一季營收強勁年增近2成挹注，公司目前看今年營運仍將成長，比去年成長幅度挑戰一成，但公司也指出，今年營運最大的變數就是台幣匯率，主要是今年以來新台幣對美元大幅升值，對任何出口廠商都有不利的影響。\r\n  此外，在今年第一季營收比重方面，整體微控制器IC營收占72%，微控制器IC於今年第一季出貨達1.4億顆，較去年同期成長34%。\r\n',
