        content: '【時報記者沈培華台北報導】微控制器(MCU)廠盛群(6202)第一季營收創下歷史單季新高，但受到匯損2900萬元創單季新高，單季淨利季減1成，惟年增1成，單季EPS為0.82元。\r\n  上月工作天數增加，出貨順暢，盛群3月營收達4.46億元，一舉創下歷史新高紀錄，並帶動第一季營收達10.86億元，創下歷年同期新高，並略於優於去年第四季的10.85億元，淡季不淡。\r\n\r\n  盛群今日舉行法人說明會，公布上季財報，第一季營收攀高至10.86億元，季增0.1%，年增19.6%；但受到人民幣比台幣貶值6%，使得公司單季匯損2900萬元，達去年一整年的總和，並且是歷史上單季最高匯損，也使得單季毛利率較去年第四季的48%微降至47.1%，加上業外受到匯損影響，單季稅後淨利1.85億元，季減10.6%，年增率為10.2%，單季每股稅後盈餘0.82元。\r\n',
